import React from 'react';
import './style.css';

function Menu(props:any) {
  return (
    <div>
      <h1>TileButton</h1>
      <ul>
        <li><a href="#">About</a></li>
        <li><a href="#">ClickButton</a></li>
        <li><a href="#">Memo</a></li>
        <li><a href="#">Other</a></li>
        <li><a href="#">TileButton</a></li>
      </ul>
      <hr />
    </div>
  );
}

export default Menu;
